import React, { Component, useState, useEffect } from 'react';
import "./FoodList.css";
import FoodCard from "./FoodCard";
import firebase from "./firebaseConfig";

async function getItemsFromBD() {
	var dataObject = await firebase.database().ref().once("value");
	console.log(dataObject);
	return dataObject.val();
}


function FoodList(props) {
	const[items, setItems] = useState([]);
	useEffect(async () => {setItems(await getItemsFromBD())},[]);
	return (
		<div>
			items.forEach(category => category.forEach(product => <FoodCard title="product" />));
                <FoodCard title="pasta" image="https://sun9-53.userapi.com/JgH6iVDAoIGwT_n-SI_oIi4bhHEclvoju1Q4-g/SSW6tkadAGs.jpg" />
                <FoodCard title="sause" image="" />
                <FoodCard title="pastry" image="https://robohash.org/dafdafw" />
		</div>
		)
}

export default FoodList;
